import React from 'react';
import '../../Home.css';


const Home = () => (
    <div>
      <h1 className='hcolour'>Welcome To Birchwood Memories</h1>
      <h2>Welcome to Birchwood Memories...</h2>
      <input type='text' />
      <img src="/Photo on 2023-07-14 at 1.27 AM.jpg" alt="Image of a Rustic Cabin that views a lake" style={{ width: '400px', height: 'auto' }} />
    </div>
  );


export default Home;
